import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Billing = () => {
    const auth = localStorage.getItem('user');
    const vehicle = localStorage.getItem('vehicleDetails');
    const category = JSON.parse(vehicle).category;
    console.log(category);
    const navigate = useNavigate();
    useEffect(() => {
        if (!auth) {
            navigate('/login');
            // alert("You are not Login !");
        }


    });


    return (
        <form>
            <div className="mt-20 inline-grid">
                <h2> This is billing Page</h2>

                <div className="grid grid-cols-2 gap-6 w-screen  mt-5 ">
                    <div className="col-span-1 justify-center">
                        <h2 className="text-start ml-2 text-xl">Mr/Mrs <span className="font-semibold">{JSON.parse(auth).name}</span>, </h2>
                        <p className="text-lg">Hello,<span className=" font-bold"> Mr/Mrs.{JSON.parse(auth).name}</span> thank you choosing our organization for Rent. We will give deriver free for {vehicle.category}. If you want to book {vehicle.category} click on <samp className=" font-bold"> Ok </samp> otherwise click on <samp className=" font-bold"> Cancel </samp> </p>
                    </div>

                    <div className="font-bold inline-grid col-span-1 text-left">
                        <h4>Bill Details</h4>
                    </div>
                </div>
            </div>
        </form>
    )
}

export default Billing;
